import { useState } from "react";
import CustomizedAccordions from "../../components/accordion/Accordion";
import GatoCastrado from "../../assets/img_animal/gato-castrado.jpg";
import Crescimento from "../../assets/img_animal/crescimento.jpg";
import "./Duvidas.css";

import { Accordion } from "@mui/material";

interface AjudaSuporteProps {
  expanded: string | false;
  setExpanded: React.Dispatch<React.SetStateAction<string | false>>;
}

const Duvidas: React.FC<AjudaSuporteProps> = ({ expanded, setExpanded }) => {
  return (
    <div className="duvida-container">
      <main className="duvida-main-container">
        <h1>Dúvida</h1>
        <div>
          <div className="duvida-main-container-topicos">
            <img src={GatoCastrado} alt="" />
            <h3>Lorem</h3>
          </div>
          <div className="duvida-main-container-topicos">
            <img src={Crescimento} alt="" />
            <h3>Lorem</h3>
          </div>
        </div>
      </main>
      <main className="duvida-frequente-main-container">
        <h1> Dúvidas frequentes</h1>
        <ol>
          <li>A clínica oferece atendimento domiciliar?</li>
          <p>Sim, oferecemos atendimento domiciliar, mas nosso foco principal é o atendimento na clínica, onde temos toda a estrutura necessária para realizar exames, procedimentos e tratamentos mais completos.</p>
          <li>Preciso agendar uma consulta ou aceitam atendimento por ordem de chegada?</li>
          <p> É recomendável agendar a consulta para evitar esperas, mas também atendemos por ordem de chegada conforme disponibilidade.</p>
          <li>Quais serviços são oferecidos na clínica?</li>
          <li>Quais são os horários de funcionamento da clínica?</li>
          <p>Atendemos de segunda a sábado, das 8h às 18h. Para atendimentos emergenciais, favor entrar em contato previamente.</p>
          <li>Como faço para agendar um atendimento domiciliar?</li>
          <p>Para agendar um atendimento domiciliar, você pode nos contatar pelo WhatsApp ou telefone. O serviço deve ser agendado com antecedência para garantirmos disponibilidade.</p>
          <li>Quais tipos de exames podem ser realizados na clínica?</li>
          <li>É necessário levar a carteira de vacinação do pet para a consulta?</li>
          <p> Sim, sempre que possível, traga a carteira de vacinação do seu pet para que possamos manter o controle atualizado.</p>
          <li>A clínica atende emergências?</li>
        </ol>
      </main>
    </div>
  );
};
export default Duvidas;
